/* This is a test of the functions in ob-hash.h.  There were already
 * some tests in LoamGTest.cpp, but since LoamGTest.cpp requires gtest
 * and therefore requires yobuild, which is 32-bit only on Mac (as of
 * July 29, 2011 anyway), so that prevents testing the hash functions on
 * the Mac64 build.  (Which is very minimal due to the lack of yobuild,
 * but it does at least build libLoam/c and libPlasma/c, and run the
 * c-based tests for them.)  And in particular, I wanted to test my
 * 32-bit and 64-bit assembly language implementations on both Mac and
 * Linux.  So, this file is mostly so ob-hash-64.S can be tested on Mac.
 *
 * Although this is conceptually redundant with the hash tests in
 * LoamGTest.cpp, I take a different approach, so it adds further
 * coverage.  In particular, the LoamGTest hash tests test both Jenkins
 * and CityHash using tests stolen from the Jenkins test suite.  This
 * file, on the other hand, tests both Jenkins and CityHash using tests
 * stolen from the CityHash test suite.
 *
 * (I will let you contemplate the irony that my C++ tests are taken
 * from tests originally written in C, and my C tests are taken from
 * tests originally written in C++.)
 */

